import {socketConnection} from "./socketConnection"

class Socket{
    private socket;

    public constructor(){
        this.socket = socketConnection;
    }
    public createSocket(){
        this.socket.on('connecton', ()=>console.log(this.socket.id));
    }
}

export const socket = new Socket();
